import "./styles.css";

export default function ImageColumnLeft() {
  return (
    <div className="associatedImage" id="image1">
      <img src="images/sample.jpeg" className="sampleImage" id="image1file" />
      <div className="sampleText" id="leftText">
      </div>
    </div>
  );
}
